description: Holds a job GUID for an upload table job.
type: object
required:
    - jobGuid
properties:
    jobGuid:
        type: string
        description: |
            Unique identifier for this job. This is automatically generated by the server and does not need to be
            specified as part of the request.
        readOnly: true
    type:
        type: string
        readOnly: true
        description: "UploadTableJobGuidHolder"
